// import Button from '@mui/material/Button';
import { Route, Routes } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';


export const Play = () => {

    const nav = useNavigate();

    return (
        <div>
            <h2>
                Play
            </h2>

            <Button
                variant='outlined'
                onClick={() => nav("/")}
            >
                I Won
            </Button>

            <Button
                variant='outlined'
                onClick={() => nav("/")}
            >
                I Lost
            </Button>

        </div>
    );
};
